    cout << "Lower bound of " << target << ": index " << lowerBound(arr, target) << endl;
    cout << "Upper bound of " << target << ": index " << upperBound(arr, target) << endl;
    cout << "Count of " << target << ": " << upperBound(arr, target) - lowerBound(arr, target) << endl;
    
